INSERT INTO `riskcontrol_rule` VALUES (4,'2024-02-27 16:07:51.715000','2024-07-22 17:09:42.293000','0','tfa','if !isNil(CurTfa.PhoneUpdatedAt) {\r\n  if Time.After(CurTfa.PhoneUpdatedAt, Time.NowAdd(Time.Day * -1)){\r\n    return RiskCode.Forbidden\r\n  }\r\n}\r\nif !isNil(CurTfa.MailUpdatedAt){\r\n  if Time.After(CurTfa.MailUpdatedAt, Time.NowAdd(Time.Day * -1)){\r\n    return RiskCode.Forbidden\r\n  }\r\n}\r\n/////\r\nif CurTfa.TxNeedVerify {\r\n  return RiskCode.Verify\r\n}\r\nreturn RiskCode.Pass',2,1,'tfa'),(5,'2024-02-27 16:09:29.015000','2024-07-23 11:05:04.787000','0','ft_sum','	chainIds = NumberList.New(Context.ChainId)\r\n	/////\r\n	befor24h = Time.TimeStampBefore(Time.Day * 1)\r\n\r\n	forRange i := SignTxs {\r\n		SignTx = SignTxs[i\r\n  ]\r\n    Log.Debug(\"tx is:\", SignTx)\r\n		asset = AggDB.AssetAttr(Context.ChainId, SignTx)\r\n    Log.Debug(\"asset is:\", asset)\r\n    if asset.AssetKind != \"erc20\" && asset.AssetKind != \"external\" {\r\n      return RiskCode.Pass\r\n  }\r\n		cnt = AggDB.AssetFtSum(Cfg.AllChainIds, SignTx.From, asset, befor24h)\r\n    Log.Debug(\"has sent\", cnt)\r\n		if asset.Symbol == \"RPG\" {\r\n			if asset.AssetKind == \"erc20\" {\r\n        if cnt + asset.Value > 100 {\r\n				  return RiskCode.Verify\r\n      }\r\n    }else{\r\n        if cnt + asset.Value > 300 {\r\n				  return RiskCode.Verify\r\n      }\r\n    }\r\n  }else if asset.Symbol == \"BNB\"{\r\n			if cnt + asset.Value > 2 {\r\n				return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MNT\"{\r\n			if cnt + asset.Value > 1000 {\r\n				return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"ETH\"{\r\n			if cnt + asset.Value > 0.3 {\r\n				return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"USDT\"{\r\n			if cnt + asset.Value > 1000 {\r\n				return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MUD\"{\r\n			if cnt + asset.Value > 100000 {\r\n				return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MIX\"{\r\n			if cnt + asset.Value > 500000  {\r\n				return RiskCode.Verify\r\n    }\r\n  }\r\n}\r\n	\r\n	return RiskCode.Pass',100,1,'AssetFtSum'),(6,'2024-02-27 16:26:57.958000','2024-08-05 18:09:46.378000','0','nft_cnt','chainIds = NumberList.New(Context.ChainId)\r\n///\r\nbefor24h = Time.TimeStampBefore(Time.Day * 1)\r\n\r\nforRange i := SignTxs {\r\n  SignTx = SignTxs[i]\r\n  Log.Debug(\"signTx:\", SignTx)\r\n  asset = AggDB.AssetAttr(Context.ChainId, SignTx)\r\n  Log.Debug(\"asset:\", asset)\r\n  if asset.AssetKind != \"erc721\" && asset.AssetKind != \"erc1155\" {\r\n    return RiskCode.Pass\r\n  }\r\n  cnt = AggDB.AssetNftCnt(chainIds, SignTx.From, asset, befor24h)\r\n  Log.Debug(\"has send:\", cnt)\r\n  if asset.Symbol == \"Weapon\" {\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Key\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Miner\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Equipment\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Fashion\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"WeaponFashion\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"Man\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MTB\"{\r\n    if cnt > 5  {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"EnergyCore\"{\r\n    if cnt + asset.Value > 5 {\r\n      return RiskCode.Verify\r\n    }\r\n  }else if asset.Symbol == \"MakBox\"{\r\n    if cnt + asset.Value > 5 {\r\n      return RiskCode.Verify\r\n    }\r\n  } else if asset.Symbol == \"FlightVehicle\"{\r\n    if cnt + asset.Value > 5 {\r\n      return RiskCode.Verify\r\n    }\r\n  }\r\n}\r\n\r\nreturn RiskCode.Pass',100,1,'AssetNftCnt'),(9,'2024-07-15 16:30:17.352000','2024-07-25 19:21:53.